import React, { Component } from 'react';

const Test = (props) => {
    const id = props.id + 1;
    const {name, location} = props.coord;
    return (
        <tr>
            <td>{id}</td>
            <td>{name}</td>
            <td>{location}</td>
        </tr>
    )
}

const Loading = () => {
    return (
      <tr>
        <td></td>
        <td>Loading&hellip;</td>
        <td></td>
        <td></td>
      </tr>
    )
  }

  class Packages extends Component {
    constructor() {
        super()
        this.state = {
            loading: true,
            packages: []
        }
    }

    componentDidMount() {
        fetch("http://localhost:3020/api/packages")
        .then(response => response.json())
        .then(data => {
          console.log(data);
          this.setState({
            loading: false,
            packages: data.results
          });
        });
      }

      render() {
        const Tests = this.state.loading ? 
          <Loading /> : 
          this.state.packages.map((packObj, idx) => <Test key={idx} id={idx} char={packObj} />);
    
          return (
              <table>
                <thead>
                  <tr>
                    <th>#</th>
                    <th>Name</th>
                    <th>Location</th>
                  </tr>
                </thead>
                <tbody>
                  {Tests}
                </tbody>
              </table>
          )
      }
    }

export default Packages;
